U -->\n    <div class=\"commonModal muneModal fadeIn\" v-if=\"showMenu\" @click=\"showMenu = false\">\n      <div class=\"muneModal-content moveUp\" @click=\"clickModalArea\">\n        <ul class=\"menuList\">\n          <li v-if=\"$store.state.hide_retired\"><div class=\"commonButton blue\" @click=\"toggleHideRetired(false)\">退会者を表示する</div></li>\n          <li v-else><div class=\"commonButton blue\" @click=\"toggleHideRetired(true)\">退会者を非表示にする</div></li>\n          <li><div class=\"commonButton gray\" @click=\"showMenu = false\">キャンセル</div></li>\n        </ul>\n      </div>\n    </div>\n  </div>\n</template>\n\n<script>\nimport TabSwipe from '@/utils/tab-swipe'\nimport MessageListItem from '@/components/lists/MessageListItem'\nimport BlankList from '@/components/lists/BlankList'\nimport { COMMON, RESET_LIST } from '@/vuex/mutation-types'\nconst NEXT_LOAD_DISTANCE = 500\nexport default {\n  components: {\n    MessageListItem,\n    BlankList\n  },\n  data () {\n    return {\n      tabSwipe: null,\n      showMenu: false,\n      tabList: [\n        {\n          tabName: 'matched',\n          key: 'matched_room',\n          action: 'getMatchedRoom',\n          label: 'マッチング',\n          blankText1: 'ここでは、あなたとマッチングが\\n成立したお相手が表示されます。',\n          blankText2: 'まだマッチングが成立していないようです。\\n気になるお相手に\\n「いいね！」をしてみましょう。',\n          linkText: '気になるお相手を探す',\n          to: { name: 'Search' },\n          badgeKey: 'unread_message_matched'\n        },\n        {\n          tabName: 'messaging',\n          key: 'messaging_room',\n          action: 'getMessagingRoom',\n          label: 'メッセージ中',\n          blankText1: 'ここでは、メッセージの交換ができます。',\n          blankText2: 'まだメッセージのやりとりがないようです。\\nマッチングしたお相手に、\\nメッセージを送ってみましょう！',\n          linkText: 'マッチングしたお相手',\n          to: { name: 'MessageList', params: { tab: 'matched' } },\n          badgeKey: 'unread_message_messaging'\n        },\n        {\n          tabName: 'event',\n          key: 'event_room',\n          action: 'getEventRoom',\n     